import React from 'react';
import { useParams } from 'react-router-dom';
import logementsData from '../assets/logements.json';
import NotFound from '../pages/NotFound/NotFound';

const FicheLogement = () => {
  const { id } = useParams();
  const parsedId = parseInt(id, 10); // Parse id to integer with radix 10

  console.log('id:', id);
  console.log('parsedId:', parsedId);

  // Find logement by id
  const logement = logementsData.find(item => item.id === parsedId);

  console.log('logementsData:', logementsData);
  console.log('logement:', logement);

  // Render NotFound if logement not found
  if (!logement) {
    return <NotFound />;
  }

  // Render logement details if found
  return (
    <div>
      <h1>{logement.title}</h1>
      <p>{logement.description}</p>
      <p>Host: {logement.host}</p>
      {/* Add additional information such as images, ratings, tags, etc. */}
    </div>
  );
};

export default FicheLogement;
